import React from 'react'
import { Link } from 'react-router-dom';

function Sidebar() {
    return (
        <div>
            <Link to='/'>Home</Link>
            <p><Link to='/meditation'>명상</Link></p>
            <p><Link to='/workout'>운동</Link></p>
        </div>
    )
}

export default Sidebar
